import React from "react";
import { Grid, Card } from "@material-ui/core";

function App() {
  return (
    <Grid
      container
      alignItems="center"
      justify="center"
      style={{ marginTop: "20px" }}
    >
      <Grid item xs={12} sm={12} md={12} lg={8}>
        <Card style={{ height: "calc(100% - 20px)" }}></Card>
      </Grid>
    </Grid>
  );
}

export default App;
